    def atualizar_season(self):
        try:
            seasons = self.get_seasons()
            dados_gerais = self.get_info_season(lista_season=seasons.get('seasons'))
            dados_schedule = self.get_schedule_season(lista_season=seasons.get('seasons'))
            # for temporada in seasons.get('seasons'):
            #   season = core.esporte.models.Season.objects.filter(id=temporada.get('id'))
            #   if not season:
            #       season = core.esporte.models.Season()
            #       season.id = temporada.get('id')
            #   season.dat_ini = temporada.get('start_datew')
            #   season.dat_fim = temporada.get('end_date')
            #   season.nome = temporada.get('name')
            #   season.save()

            for dado_geral in dados_gerais:
                for standing in dado_geral.get('standings'):
                    for grupo in standing.get('groups'):
                        for times in grupo.get('standings'):
                            # salvar/editar os times
                            time = core.esporte.models.Time.objects.filter(id=times.get('competitor').get('id')).first()
                            if not time:
                                time = core.esporte.models.Time()
                            time.nome = times.get('competitor').get('name')
                            time.id = times.get('competitor').get('id')
                            time.save()

                            performance_time = core.esporte.models.PerformaceTime.objects.filter(season_id='sr:season:105353',time=times.get('competitor').get('id')).first()
                            if not performance_time:
                                performance_time = core.esporte.models.PerformaceTime()
                                performance_time.season_id = 'sr:season:105353'
                                performance_time.time_id = times.get('competitor').get('id')
                            performance_time.info = json.dumps(times)
                            performance_time.save()

            for dado in dados_schedule:
                for encontro in dado.get('schedules'):
                        # salvar/editar os eventos
                    evento = core.esporte.models.Evento.objects.filter(
                        id=encontro.get('sport_event').get('id')).first()
                    if not evento:
                        evento = core.esporte.models.Evento()

                    evento.id = encontro.get('sport_event').get('id')
                    evento.nome = encontro.get('sport_event').get('id')
                    evento.season_id = encontro.get('sport_event').get('sport_event_context').get('season').get('id')
                    evento.data = encontro.get('sport_event').get('start_time')
                    evento.resultado_partida = str(encontro.get('sport_event_status'))
                    evento.campeonato_id = encontro.get('sport_event').get('sport_event_context').get(
                        'competition').get('id')
                    evento.save()


            return True
        except:
            return False
    def atualizar_tudo(self):
        status_response = False
        status_season = self.atualizar_season()
        status =  self.atualizar_dados()


        if status and status_season:
            status_response = True
        return status_response
    def atualizar_dados(self):
        dados = self.pegar_versus_futebol()

        for times in dados.get('competitors'):
            # salvar/editar os times
            time = core.esporte.models.Time.objects.filter(id=times.get('id')).first()
            if not time:
                time  = core.esporte.models.Time()
            time.nome = times.get('name')
            time.id = times.get('id')
            time.save()
        for encontros_passados in dados.get('last_meetings'):

            # salvar/editar os esportes

            esporte = core.esporte.models.Esporte.objects.filter(id=encontros_passados.get('sport_event').get('sport_event_context').get('sport').get('id')).first()
            if not esporte:
                esporte = core.esporte.models.Esporte()
            esporte.nome = encontros_passados.get('sport_event').get('sport_event_context').get('sport').get('name')
            esporte.id = encontros_passados.get('sport_event').get('sport_event_context').get('sport').get('id')
            esporte.save()

            season_id = core.esporte.models.Season.objects.values_list('id', flat=True).filter(
                id=encontros_passados.get('sport_event').get('sport_event_context').get('season').get('id')).first()

            # salvar/editar os campeonatos
            campeonato = core.esporte.models.Campeonato.objects.filter(id=encontros_passados.get('sport_event').get('sport_event_context').get('competition').get('id')).first()
            if not campeonato:
                campeonato = core.esporte.models.Campeonato()
            campeonato.id = encontros_passados.get('sport_event').get('sport_event_context').get('competition').get('id')
            campeonato.nome = encontros_passados.get('sport_event').get('sport_event_context').get('competition').get('name')
            campeonato.status=True
            campeonato.save()

            # salvar/editar os eventos
            evento = core.esporte.models.Evento.objects.filter(id=encontros_passados.get('sport_event').get('id')).first()
            if not evento:
                evento = core.esporte.models.Evento()

            evento.id = encontros_passados.get('sport_event').get('id')
            evento.nome = encontros_passados.get('sport_event').get('id')
            evento.season_id = season_id if season_id else None
            evento.data = encontros_passados.get('sport_event').get('start_time')
            evento.time_a_id = encontros_passados.get('statistics').get('totals').get('competitors')[0].get('id')
            evento.time_b_id = encontros_passados.get('statistics').get('totals').get('competitors')[1].get('id')
